import React from "react";

const Navbar = ({ isLoggedIn }) => {
  return (
    <nav style={styles.navbar}>
      <a href="/" style={styles.navItem}>
        Home
      </a>
      <div style={styles.rightItems}>
        <a href="/register" style={styles.navItem}>
          Register
        </a>
        <a href="/login" style={styles.navItem}>
          Login
        </a>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 40px",
    backgroundColor: "#333",
  },
  rightItems: {
    display: "flex",
    gap: "20px",
  },
  navItem: {
    color: "white",
    textDecoration: "none",
    fontSize: "18px",
  },
};

export default Navbar;
